import {Constants} from "../constants/authConstance"

export const authTokenAction = (data) => {
    return {
        type: Constants.AUTH_TOKEN,
        payload: data
    }
}

export const authLoggedInAction = () => {
    return {
        type: Constants.LOGGED_IN,
        payload: true
    }
}

export const authLoggedOutAction = () => {
    return {
        type: Constants.LOGGED_OUT,
        payload: false
    }
}
